import React from 'react'
import {Divider, Drawer, Grid} from '@material-ui/core'

interface IProps{
    open: boolean
    handleClose: () => void
}

const SideMenu: React.FC<IProps> = (props) =>{

    const {open, handleClose} = props
    
    return(
        <Drawer
            anchor='left'
            open = {open}
            onClose={handleClose}>
            Test Me!
            <Grid
                container>
                Test Me!
            </Grid>
            <Divider orientation='horizontal' />
            <Grid
                container>

            </Grid>
        </Drawer>
    )
}

export default SideMenu;
